/* eslint-disable react/react-in-jsx-scope */
import "./App.css";
import Header from "./component/Header/Header";
import ListProductHere from "./component/listProduct/listProduct";
import Maplocation from "./component/Maplocation/Maplocation";
import Navbar from "./component/Navbar/Navbar";
import ContactUs from "./From/From";
import Footer from "./component/Footer/Footer";
import { useEffect, useState } from "react";
import PacmanLoader from "react-spinners/PacmanLoader";
import { Route, Routes } from "react-router-dom";
import ReminderList from "./component/reminderBirtdays/ReminderList";

function App() {
  const [isLoading, setLoading] = useState(false);

  useEffect(() => {
    setLoading(true);

    setTimeout(() => {
      setLoading(false);
    }, 3000);
  }, []);


  return (
    <>
      <div className="App">
        {
          isLoading ? (
            // membuat div agar react spiners bisa berada di tengah layar
            <div className='Loading'>
              <PacmanLoader color={"rgba(122, 17, 124, 1)"} loading={isLoading} size={60} />
            </div>
          ) : (
            <div>
              < Navbar/>
              <Routes>
                <Route path="/" element={< Header />}/>
                <Route path="/listProduct" element={<ListProductHere  />}/>
                <Route path="/Maplocation" element={< Maplocation />}/>
                <Route path="/From" element={< ContactUs  />}/>
                <Route path="/reminder" element={< ReminderList />}/>
              </Routes>
              <Footer/>







            </div>
          )

        }
      </div>
    </>
  );
}

export default App;
